import React from 'react';
import Slider from 'react-slick';
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";

const ImageCarousel = () => {
  const images = [
    "https://www.salesian.vic.edu.au/app/uploads/2023/12/Salesian-DUX-01-1.jpg", // Replace this with your image path
    "https://www.salesian.vic.edu.au/app/uploads/2024/03/MG_0861.jpg", // Add more images here
    "https://www.salesian.vic.edu.au/app/uploads/2023/12/Salesian-DUX-01-1.jpg", // Replace this with your image path
    "/path_to_your_image/image3.png"
  ];

  // Slick carousel settings
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    arrows: true,
  };

  return (
    <div style={{ width: '80%', margin: '0 auto' }}>
      <Slider {...settings}>
        {images.map((image, index) => (
          <div key={index}>
            <img
              src={image}
              alt={`carousel-${index}`}  // Fixed the alt tag
              style={{ width: '100%', height: 'auto', maxHeight: '600px', objectFit: 'cover' }}
            />
          </div>
        ))}
      </Slider>
    </div>
  );
};

export default ImageCarousel;
